const int red = 7
const int green = 6
const int blue = 5

int r = 255; 
int b; /* blue led value is temporally 0 */
int g; /* green led value is temporally 0 */

int t = 1000;

void setup()


void loop() {

for (/* no initialization */; r>=0, b<255; b++, r--) /*red -> blue*/

{

analogWrite(red, r);

analogWrite(blue, b);

delay(t);

}

for (/* no initialization */; b>=0, g<255; g++, b--) /*blue -> green*/

{

analogWrite(blue, b);

analogWrite(green, g);

delay(t);

}

for (/* no initialization */; g>=0, r<255; r++, g--) /*green -> red*/

{

analogWrite(red, r);

analogWrite(green, g);

delay(t);

}

}

