import Fastify from "fastify";
import { http } from "@nitric/sdk";
import { setupFastify } from "../../resources/fastify-setup";
import { RoleRepository } from "../../repositories/role.repository";
import { UserRepository } from "../../repositories/user.repository";
import { registerStaffRoutes } from "./routes";
import dbClient from "../../db";
import { FastifyRequest, FastifyReply } from "fastify";
import { LogtoManagementClient } from "../../resources/logto-management-client";
import { LogtoUser } from "../../resources/logto-fastify";
import { FirewallRepository } from "../../repositories/firewall.repository";
import { SiteRepository } from "../../repositories/site.repository";

// Add this before creating the Fastify instance
declare module "fastify" {
  export interface FastifyInstance {
    db: Awaited<ReturnType<typeof dbClient>> | null;
    roleRepository: RoleRepository | null;
    userRepository: UserRepository | null;
    firewallRepository: FirewallRepository | null;
    siteRepository: SiteRepository | null;
    logtoManagement: LogtoManagementClient | null;
    verifyLogtoToken: (
      request: FastifyRequest,
      reply: FastifyReply
    ) => Promise<boolean>;
    requireScopes: (
      scopes: string[]
    ) => (request: FastifyRequest, reply: FastifyReply) => Promise<boolean>;
    requireRoles: (
      roles: string[]
    ) => (request: FastifyRequest, reply: FastifyReply) => Promise<boolean>;
    getLogtoUserClaims: (request: FastifyRequest) => LogtoUser | null;
    getLogtoUserClaim: (request: FastifyRequest, claimName: string) => any;
  }
}

async function bootstrap(port: number) {
  const fastify = Fastify({
    logger: true,
  });

  // Setup Fastify with plugins, error handlers, etc.
  await setupFastify(fastify, {
    serviceName: "Staff",
    serviceVersion: "1.0.0",
    setupRepositories: (fastify, db) => {
      fastify.decorate("roleRepository", new RoleRepository(db));
      fastify.decorate("userRepository", new UserRepository(db));
      fastify.decorate("firewallRepository", new FirewallRepository(db));
      fastify.decorate("siteRepository", new SiteRepository(db));
      // const logtoManagement = new LogtoManagementClient();
      // fastify.decorate("logtoManagement", logtoManagement);
    },
    logtoConfig: {
      jwksUrl: `${process.env.LOGTO_EXPRESS_ENDPOINT}/oidc/jwks`,
      issuer: `${process.env.LOGTO_EXPRESS_ENDPOINT}/oidc`,
      audience: "",
    },
  });

  // Register all routes for this service
  registerStaffRoutes(fastify);

  const isCloud = process.env.NITRIC_ENVIRONMENT === "cloud";
  const address = await fastify.listen({ port: isCloud ? port : 8001 });

  console.log(`Server listening on ${address}`);

  return fastify.server;
}

// Start the server with Nitric
http(bootstrap, () => {
  console.log("Staff service started");
});

